import '../yourProfile.scss'
import { connect } from 'react-redux';
import React from 'react';
import './auctionManager.scss'
import { getAuctionWithWinnersFromDB } from '../../../utils/auctionUtils';
import { setUserByStorage } from '../../../store/actions/user';
import { getUserOrdersListFromDB } from '../../../utils/userUtils';
const AuctionResults = (props) => {

    useEffect(() => {

        getAuctionWithWinnersFromDB(props.order.auctionId._id).then(succ => {
            setProductsList(succ.data.productList);//רשיתמ מוצרים עם הזוכים של מכירה זו
            setStatus(succ.data.status);
        });

        setDetails(props.order.orderDetails);//פרטי הזמנה זו
        // setGifts(props.order.giftCodes)//מתנות של הזמנה זו

    }, []);

    return (
        <>

            <h1>Chinese auction results</h1>
            {productsList.map((p, index) => {
                if (p.winnerId) return <p key={index}>{p.name}:{p.winnerId.confidentiality ? "Anonymous" : p.winnerId.userName}</p>
            })}
        </>
    );

}

const mapStateToProps = (state) => {
    return {
        auction_id: state.auctionManager.selected_auction_to_options

    };
}
export default connect(mapStateToProps, { setUserByStorage })(AuctionResults);
